import React from 'react'
import Container from 'react-bootstrap/Container'
import Row from 'react-bootstrap/Row'
import Col from 'react-bootstrap/Col'
import 'bootstrap/dist/css/bootstrap.min.css'
import { getNote, notes } from './utils/noteHelpers'

const list = notes.map((note) => <li>{note}</li>)
console.log(list)
function App() {
	return (
		<Container>
			<Row>
				<Col style={{ backgroundColor: 'red' }} xs={12} md={4}>
					<ul>
						<li>Eat</li>
						<li>Sleep</li>
						<li>Repeat</li>
					</ul>
				</Col>
				<Col style={{ backgroundColor: 'grey' }} xs={12} md={8}>
					Editor
				</Col>
			</Row>
		</Container>
	)
}

export default App

// eslint-disable-next-line no-unused-vars
const styles = {
	heading: {
		fontSize: 100
	}
}
